CREATE DEFINER=`root`@`localhost` FUNCTION `calcularDiferenciaFechas`(fecha_inicio DATETIME, fecha_fin DATETIME) RETURNS varchar(255) CHARSET utf8mb3 COLLATE utf8mb3_spanish2_ci
    DETERMINISTIC
BEGIN
    DECLARE diff_months INT;
    DECLARE diff_days_total INT;
    DECLARE remaining_days INT;
    DECLARE diff_weeks INT;
    DECLARE diff_hours INT;
    DECLARE diff_minutes INT;
    DECLARE diff_seconds INT;
    DECLARE result VARCHAR(255);

    -- Calcula la diferencia en meses
    SET diff_months = PERIOD_DIFF(DATE_FORMAT(fecha_fin, '%Y%m'), DATE_FORMAT(fecha_inicio, '%Y%m'));

    -- Calcula el total de días de diferencia
    SET diff_days_total = DATEDIFF(fecha_fin, fecha_inicio);

    -- Calcula las semanas y días restantes después de contar los meses completos
    SET remaining_days = DATEDIFF(fecha_fin, DATE_ADD(fecha_inicio, INTERVAL diff_months MONTH));
    SET diff_weeks = FLOOR(remaining_days / 7);
    SET remaining_days = remaining_days % 7;

    -- Calcula las horas, minutos y segundos restantes
    SET diff_hours = TIMESTAMPDIFF(HOUR, fecha_inicio, fecha_fin) % 24;
    SET diff_minutes = TIMESTAMPDIFF(MINUTE, fecha_inicio, fecha_fin) % 60;
    SET diff_seconds = TIMESTAMPDIFF(SECOND, fecha_inicio, fecha_fin) % 60;

    -- Construye el resultado como un string
    SET result = CONCAT(
        IF(diff_months > 0, CONCAT(diff_months, IF(diff_months = 1, ' mes', ' meses')), ''),
        IF(diff_weeks > 0, CONCAT(' ', diff_weeks, IF(diff_weeks = 1, ' semana', ' semanas')), ''),
        IF(remaining_days > 0, CONCAT(' ', remaining_days, IF(remaining_days = 1, ' día', ' días')), ''),
        IF(diff_hours > 0, CONCAT(' ', diff_hours, IF(diff_hours = 1, ' hora', ' horas')), ''),
        IF(diff_minutes > 0, CONCAT(' ', diff_minutes, IF(diff_minutes = 1, ' minuto', ' minutos')), ''),
        IF(diff_seconds > 0, CONCAT(' ', diff_seconds, IF(diff_seconds = 1, ' segundo', ' segundos')), '')
    );

    RETURN TRIM(result);
END ;;
DELIMITER ;
