CREATE DEFINER=`root`@`%` FUNCTION `validar_ruta_unica`(
    p_idiomaId INT,
    p_tipoId INT,
    p_nivelId INT
) RETURNS tinyint(1)
    DETERMINISTIC
BEGIN
    DECLARE existe INT;

