CREATE DEFINER=`root`@`%` PROCEDURE `actualizar_estado_actividad`()
BEGIN
    -- Poner estAct en 0 cuando la fecha actual supere fecActHasta
    UPDATE tm_actividad_edu 
    SET estadoAct = 0 
    WHERE DATE(fecActHasta) < CURDATE() 
        AND (estadoAct != 0 or estadoAct != 2);
END ;;
